"""
Given a matrix, and a target,
return the number of non-empty submatrices that sum to target.

A submatrix x1, y1, x2, y2 is the set of all cells matrix[x][y] with x1 <= x <= x2 and y1 <= y <= y2.

Two submatrices (x1, y1, x2, y2) and (x1', y1', x2', y2') are different
if they have some coordinate that is different: for example, if x1 != x1'.


Example 1:

Input:
    matrix = [[0,1,0],[1,1,1],[0,1,0]], target = 0
Output:
    4
Explanation:
    The four 1x1 submatrices that only contain 0.

Example 2:

Input:
    matrix = [[1,-1],[-1,1]], target = 0
Output:
    5
Explanation:
    The two 1x2 submatrices, plus the two 2x1 submatrices, plus the 2x2 submatrix.

Note:
    1 <= matrix.length <= 300
    1 <= matrix[0].length <= 300
    -1000 <= matrix[i] <= 1000
    -10^8 <= target <= 10^8
"""


class Solution(object):
    def numSubmatrixSumTarget(self, matrix, target):
        """
        :type matrix: List[List[int]]
        :type target: int
        :rtype: int
        """

        r, c = len(matrix), len(matrix[0])
        s = [[0 for _ in range(c + 1)] for _ in range(r + 1)]
        # row sum
        for i in range(r):
            ss = 0
            for j in range(c):
                ss += matrix[i][j]
                s[i][j] = ss
        # matrix sum
        for j in range(c):
            ss = 0
            for i in range(r):
                ss += s[i][j]
                s[i][j] = ss

        res = 0
        for lj in range(c):
            for rj in range(lj, c):
                cache = {0: 1}
                for i in range(r):
                    left = 0 if lj == 0 else s[i][lj - 1]
                    v = s[i][rj] - left
                    res += cache.get(v - target, 0)
                    cache[v] = cache.get(v, 0) + 1

        return res


